async function searchPlayer({ queryKey }) {
  const { firstName, lastName } = queryKey[1];
  console.log(firstName, lastName);
  const API_BASE = "http://localhost:3001";
  const res = await fetch(`${API_BASE}/search-player`, {
    method: "POST",
    headers: {
      "Content-Type": "application/json",
    },
    body: JSON.stringify({
      firstName,
      lastName,
    }),
  });

  if (!res.ok) {
    throw new Error("player search not okay");
  }

  return res.json();
}

export default searchPlayer;
